		"description": [
			{
				"type": "heading",
				"data": "Biome Box"
			},
			{
				"type": "subheading",
				"data": "Introduction"
			},
			{
				"type": "paragraph",
				"data": [
					"Beginning to imagine to find the resources being spoonfed to the player in the form of a loot box found in their native biomes; that's the idea of the Biome Box add-on. This add-on will spawn rare boxes throughout the world filled with content native to the biome they spawn in. With so much as 22 boxes to find scattered around every major biome, seeing all of them in your base might cna be a big flex to make proving you travelled across those biomes. The boxes aren't structures and can be treated as entities, they don't have a fixed coordinate to spawn on so living in a biome may spawn more.."
				]
			},
			{
				"type": "subheading",
				"data": "Mechanics"
			},
			{
				"type": "paragraph",
				"data": [
					"There are entities that spawn in the world but they despawn after playing an animation to place its block. Here's a list of all the biomes that are currently supported by the add-on."
				]
			},
			{
				"type": "unordered_list",
				"data": [
					{
						"list": [
							"Jungle",
							"Mangrove Swamp",
							"Mesa",
							"Mushroom Island",
							"Nether Wastes",
							"Ocean",
							"Plains",
							"River",
							"Savanna",
							"Soulsand Valley",
							"Stone Beach",
							"Swamp",
							"Taiga",
							"The End",
							"Warped Forest",
							"Basalt Deltas",
							"Beach",
							"Cherry Grove",
							"Crimson Forest",
							"Desert",
							"Extreme Hills",
							"Flat",
							"Forest",
							"Ice"
						]
					}
				]
			},
			{
				"type": "image",
				"data": [
					"set.png",
					"biomes.png"
				]
			},
			{
				"type": "paragraph",
				"data": [
					"To see even more specific details, please view the other tabs."
				]
			},
		],
