		"description": [
			{
				"type": "heading",
				"data": "Tatsulok"
			},
			{
				"type": "subheading",
				"data": "Introduction"
			},
			{
				"type": "paragraph",
				"data": [
					"This add-on adds a new weapon in the game, a boomerang! There are other add-ons about this subject but this is my version. There are two types of boomerangs, a normal one and a piercing one. You can have fun with these new weapons just by throwing them around.",
					"The boomerangs you throw could have different effects, depending on which one you craft. The boomerangs will return to you like an actual boomerang so you should worry about losing them. It should be worth noting that this is an add-on that's not compatible with multiplayer."
				]
			},
			{
				"type": "subheading",
				"data": "Mechanics"
			},
			{
				"type": "paragraph",
				"data": [
					"Once a boomerang is thrown, it'll be removed from your inventory and a projectile will be launched directly towards your crosshair."
				]
			},
			{
				"type": "paragraph",
				"data": [
					"To see even more specific details, please view the other tabs."
				]
			},
			{
				"type": "image",
				"data": [
					"set.png"
				]
			}
		],
