		"description": [
			{
				"type": "heading",
				"data": "Mob Blocks"
			},
			{
				"type": "subheading",
				"data": "Introduction"
			},
			{
				"type": "paragraph",
				"data": [
					"This is a simple add-on that allows you to use /fill with vanilla Minecraft mobs. Is it silly? Yes. Is it stupid? Yes, is it practical? Maybe(?). Is it fun? Y E S. With this add-on, you can do /fill with mobs because this add-on adds blocks that spawns their designated mobs, even the Ender Dragon and Wither Boss :)",
					"The new blocks should be able to help in automating certain things in the game."
				]
			},
			{
				"type": "subheading",
				"data": "Mechanics"
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "They're NOT obtainable in survival. Placing a Mob Block will spawn its designated mob instantly. There are more than 80 blocks in the add-on's current version. As Minecraft continuously gets updates, this add-on will be updated too. Minecarts, Lightning Bolts, and Ender Crystals can be spawned too.",
					"image": "inventory.png"
				}
			},
			{
				"type": "paragraph",
				"data": [
					"To see even more specific details, please view the other tabs."
				]
			},
		],
