    "dat_link": "https://link-center.net/131911/artisans-blocks-dat",
		"res_link": "https://direct-link.net/131911/artisans-blocks-res",
		"one_link": "",
    "title": "Artisan's Blocks",
    "flat": "artisans_blocks",
		"short_description": "It adds many decorative blocks used to enhance builds.",
		"tags": [
			"blocks",
			"decorative",
			"expansion"
		],
		"uploaded_on": { "dd": 2, "mm": 9, "yyyy": 2020 },
		"updated_on": { "dd": 11, "mm": 9, "yyyy": 2023 },
		"version": { "main": 1, "sub": 2 },
		"description": [
			{
				"type": "heading",
				"data": "Artisan's Blocks"
			},
			{
				"type": "subheading",
				"data": "Introduction"
			},
			{
				"type": "paragraph",
				"data": [
					"There are many ways we can enhance our builds, but things tend to look awkward if we don't have the right materials and blocks. Sure imagination could fill that in, but not everyone will have your vision until you start labeling things (even more awkward). This is an add-on that adds a LOT of new blocks to help you decorate your world with new content and make them livelier.",
					"Content ranging from meshes of metal, pillars, and wooden furniture, this is an add-on essential for adding more detail to your builds. It also expands on other elements of the game such as glass panes as handrails and windows, and chains for every metal."
				]
			},
			{
				"type": "subheading",
				"data": "Content"
			},
			{
				"type": "paragraph",
				"data": [
					"The add-on expands on the decorative aspect of the game, and allows creators to add further details to their builds. The number of blocks exceed 1,000 when accounting for every subvariant, inflating the add-on's size. Here are some of the new decorative blocks that the add-on features."
				]
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "The build demonstrates Awnings and Scattered Paths used in an urban setting. There are two types of awnings that are featured in the add-on, round and shed types. The scattered paths are just stones that mimic carpets, most suitable for outdoors.",
					"image": "bricks.png"
				}
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "The game already has chains, but the add-on features an expansive array of new blocks that mimic the item. Featuring chains big and small.. and another addition. Doric Pillars are demonstrated in the photo too. They're cylindrical pillars in contrast to its other types.",
					"image": "chains.png"
				}
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "I've been to many buffets and dinner parties, and many of the catering equipment and food are placed on top of Clothed Tables. The image features handrails too and it also has its glass counterparts.",
					"image": "miscs.png"
				}
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "Tatami Mats were pretty hard to code, their logic being too exclusive. The Shoji Screens were quite hard to handle too but they're duplicate code from a different block from the same add-on. The Tatami Mats can only have a 1:2 aspect ratio to conserve whatever sanity I had left from attempting to develop them infinitely scalable.",
					"image": "screens.png"
				}
			},
			{
				"type": "compound",
				"ratio": {
					"paragraph": "50%",
					"image": "50%"
				},
				"direction": "PI",
				"data": {
					"paragraph": "The image shows that this add-on truly has a lot to offer, there are a lot of wooden blocks to use to add details to your worlds.",
					"image": "woods.png"
				}
			}
		],
